css:
.atom-text-editor,
:host {
  background-color: #151718;
  color: #d4d7d6;
}
.atom-text-editor,
:host {
  background-color: #151718;
  color: #d4d7d6;
}
.atom-text-editor .wrap-guide,
:host .wrap-guide {
  background: rgba(245, 250, 255, 0.04);
}
.atom-text-editor .indent-guide,
:host .indent-guide {
  color: rgba(245, 250, 255, 0.04);
}
.atom-text-editor .invisible-character,
:host .invisible-character {
  color: rgba(255, 255, 255, 0.1);
}
.atom-text-editor .gutter,
:host .gutter {
  background-color: #0e1112;
  color: #404b53;
}
.atom-text-editor .gutter .line-number,
:host .gutter .line-number {
  background: #0e1112;
  color: #404b53;
  padding-left: 10px;
}
.atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #060708;
  color: #55b5db;
  font-weight: 100;
}
.atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  background-color: #060708 !important;
  color: #55b5db;
}
.atom-text-editor .gutter .line-number:hover,
:host .gutter .line-number:hover {
  background-color: #0e1112 !important;
  color: #55b5db;
}
.atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
.atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
.atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #FFF;
  background: #404b53;
}
.atom-text-editor .invisible,
:host .invisible {
  color: rgba(255, 255, 255, 0.1);
}
.atom-text-editor .cursor,
:host .cursor {
  border-color: #d4d7d6 !important;
  border-left: solid 2px;
}
.atom-text-editor .selection .region,
:host .selection .region {
  background-color: rgba(85, 181, 219, 0.6);
}
.atom-text-editor .scroll-view,
:host .scroll-view {
  padding-left: 10px;
}
.atom-text-editor .line.cursor-line,
:host .line.cursor-line {
  background: rgba(0, 0, 0, 0.2) !important;
  padding-left: 10px;
  margin-left: -10px;
}
.comment {
  color: #41535b;
  background: none;
}
.keyword {
  color: #9fca56;
}
.keyword.control {
  color: #9fca56;
}
.keyword.operator {
  color: #9fca56;
}
.keyword.other.special-method {
  color: #9fca56;
}
.keyword.other.unit {
  color: #9fca56;
}
.storage {
  color: #e6cd69;
}
.storage.modifier {
  color: #e6cd69;
}
.constant {
  color: #cd3f45;
}
.constant.character.escape {
  color: #cd3f45;
}
.constant.numeric {
  color: #cd3f45;
}
.constant.other.color {
  color: #cd3f45;
}
.constant.other.symbol {
  color: #cd3f45;
}
.variable {
  color: #9fca56;
}
.variable.interpolation {
  color: #9fca56;
}
.variable.parameter.function {
  color: #55b5db;
}
.invalid.illegal,
.invalid.deprecated {
  background: none;
  color: #cd3f45;
}
.string {
  color: #55b5db;
}
.string .constant {
  color: #55b5db;
}
.string.regexp {
  color: #55b5db;
}
.string.regexp .constant.character.escape,
.string.regexp .source.ruby.embedded,
.string.regexp .string.regexp.arbitrary-repitition {
  color: #55b5db;
}
.string.regexp.group {
  color: #55b5db;
}
.string.regexp.character-class {
  color: #55b5db;
}
.string.regexp .source.ruby.embedded {
  color: #55b5db;
}
.string .variable {
  color: #9fca56;
}
.string.other.link {
  color: #55b5db;
}
.source .string .source,
.source .string .meta.embedded.line {
  color: #55b5db;
}
.source .string .punctuation.section.embedded {
  color: #55b5db;
}
.source .string .punctuation.section.embedded .source {
  color: #55b5db;
}
.punctuation.terminator {
  color: #858d8a;
}
.punctuation.separator {
  color: #858d8a;
}
.punctuation.definition {
  color: #858d8a;
}
.punctuation.definition.comment {
  color: #41535b;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.array {
  color: #55b5db;
}
.punctuation.definition.parameters {
  color: #d4d7d6;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #d4d7d6;
}
.punctuation.definition.bold {
  color: #d4d7d6;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #d4d7d6;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #d4d7d6;
}
.support {
  color: #a074c4;
}
.support.class {
  color: #a074c4;
}
.support.function {
  color: #a074c4;
}
.support.function.any-method {
  color: #a074c4;
}
.support.constant {
  color: #cd3f45;
}
.support.type.property-name.css {
  color: #a074c4;
}
.source .entity.name.tag,
.source .entity.other.attribute-name,
.meta.tag.inline,
.meta.tag.inline .entity {
  color: #9fca56;
}
.tag,
.tag .entity {
  color: #55b5db;
}
.html .string {
  color: #d4d7d6;
}
.html .punctuation.definition.tag {
  color: #55b5db;
}
.html .entity.name.tag {
  text-decoration: done;
}
.html .entity.name.tag.structure {
  color: #55b5db;
}
.html .entity.name.tag.block {
  color: #55b5db;
}
.html .entity.other.attribute-name {
  color: #9fca56;
}
.entity {
  color: #55b5db;
}
.entity.name.type {
  color: #55b5db;
  text-decoration: none;
}
.entity.other.inherited-class {
  color: #55b5db;
}
.entity.name.function {
  color: #55b5db;
}
.entity.name.class,
.entity.name.type.class {
  color: #55b5db;
}
.entity.name.section {
  color: #55b5db;
}
.entity.name.tag {
  color: #55b5db;
  text-decoration: done;
}
.entity.other.attribute-name {
  color: #9fca56;
}
.entity.other.attribute-name.id {
  color: #9fca56;
}
.meta.link {
  color: #d4d7d6;
}
.meta.require {
  color: #d4d7d6;
}
.meta.brace.curly {
  color: #858d8a;
}
.meta.brace.round {
  color: #d4d7d6;
}
.meta.comma {
  color: #858d8a;
}
.meta.selector {
  color: #858d8a;
}
.meta.separator {
  background-color: #858d8a;
  color: #858d8a;
}
.none {
  color: #d4d7d6;
}
.markup.bold {
  color: #d4d7d6;
  font-weight: bold;
}
.markup.changed {
  color: #d4d7d6;
}
.markup.deleted {
  color: #d4d7d6;
}
.markup.italic {
  color: #d4d7d6;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #d4d7d6;
}
.markup.inserted {
  color: #d4d7d6;
}
.markup.list {
  color: #d4d7d6;
}
.markup.quote {
  color: #d4d7d6;
}
.markup.raw.inline {
  color: #d4d7d6;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #d4d7d6;
}
atom-text-editor[mini] .scroll-view,
:host(.mini) .scroll-view {
  padding-left: 1px;
}
.bracket-matcher .region {
  border-bottom: 1px solid #55b5db;
  margin-top: 2px;
}
.html .meta.tag.any {
  color: #9fca56;
}
.html .entity.name.tag.block,
.html .entity.name.tag.inline,
.html .entity.name.tag.name {
  color: #55b5db;
}
.html .entity.other.attribute-name.id.html {
  color: #9fca56;
}
.html .punctuation.separator.key-value {
  color: #9fca56;
}
.html .string.quoted.double {
  color: #cbe2a4;
}
.html .string.quoted.double .punctuation.definition.string.begin,
.html .string.quoted.double .punctuation.definition.string.end {
  color: #9fca56;
}
.html .string.quoted.double .punctuation.definition.string .separator.key-value.html {
  color: #9fca56;
}
.jade {
  color: #d4d7d6;
}
.jade .comment.jade {
  color: #41535b;
}
.jade .storage.type.function.jade {
  color: #9fca56;
}
.jade .meta.control.flow.jade {
  color: #cd3f45;
}
.jade .source.script .meta.brace.round.js,
.jade .source.script .meta.brace.curly.js {
  color: #858d8a;
}
.jade .entity.name.tag.jade {
  color: #55b5db;
}
.jade .storage.type.import.include.jade {
  color: #cbe2a4;
}
.jade .variable.control.import.include.jade {
  color: #9fca56;
}
.jade .constant.id {
  color: #e6cd69;
}
.jade .constant.language.js {
  color: #a074c4;
}
.jade .text.jade {
  color: #d4d7d6;
}
.jade .punctuation.separator.key-value.jade {
  color: #55b5db;
}
.jade .string.quoted.jade {
  color: #d4d7d6;
}
.source.json .constant.language {
  color: #cd3f45;
}
.source.json .meta.structure.dictionary.json .string.quoted.json {
  color: #55b5db;
}
.source.json .meta.structure.dictionary.json .meta.structure.dictionary.value.json .string.quoted.json {
  color: #d4d7d6;
}
.source.json .meta.structure.dictionary.json .meta.structure.dictionary.value.json .string.quoted.json .punctuation.definition.string {
  color: #d4d7d6;
}
.source.json .meta.structure.dictionary.json .meta.structure.dictionary.value.json .meta.structure.dictionary.json .string.quoted.json {
  color: #55b5db;
}
.source.json .meta.structure.dictionary.json .meta.structure.dictionary.value.json .meta.structure.dictionary.json .string.quoted.json .punctuation.definition.string {
  color: #55b5db;
}
.source.json .meta.structure.dictionary.json .meta.structure.dictionary.value.json .meta.structure.dictionary.json .meta.structure.dictionary.value.json .string.quoted.json {
  color: #d4d7d6;
}
.source.json .meta.structure.dictionary.json .meta.structure.dictionary.value.json .meta.structure.dictionary.json .meta.structure.dictionary.value.json .string.quoted.json .punctuation.definition.string {
  color: #d4d7d6;
}
.mustache .meta.tag.template {
  color: #9fca56;
}
.mustache .meta.tag.template .entity.name.tag {
  color: #cbe2a4;
}
